// ==UserScript==
// @name         Notificador de Task com Som e Notificação
// @namespace    http://tampermonkey.net/
// @version      1.6
// @description  Notifica quando o há task disponível com som e notificação no desktop
// @author       arthurmelo
// @match        https://www.raterhub.com/evaluation/rater
// @match        https://www.raterhub.com/evaluation/rater/task/index
// @grant        none
// @downloadURL https://update.greasyfork.org/scripts/510047/Notificador%20de%20Task%20com%20Som%20e%20Notifica%C3%A7%C3%A3o.user.js
// @updateURL https://update.greasyfork.org/scripts/510047/Notificador%20de%20Task%20com%20Som%20e%20Notifica%C3%A7%C3%A3o.meta.js
// ==/UserScript==

(function() {
    'use strict';

    // Função para tocar som local em formato base64
    function tocarSom() {
        var audio = new Audio('data:audio/mp3;base64, ');
        audio.play();
        console.log("Som tocado!");
    }


    // Função para mostrar notificação de desktop
    function mostrarNotificacao() {
        if (Notification.permission === "granted") {
            new Notification("Task disponível!", {
                body: "Apareceu task, vem trabalhar!",
                icon: "https://iconarchive.com/download/i102645/google/noto-emoji-animals-nature/22222-lion-face.ico" // Ícone opcional
            });
            console.log("Notificação enviada!");
        } else if (Notification.permission !== "denied") {
            Notification.requestPermission().then(permission => {
                if (permission === "granted") {
                    new Notification("Task disponível!", {
                        body: "Apareceu task, vem trabalhar!",
                        icon: "https://iconarchive.com/download/i102645/google/noto-emoji-animals-nature/22222-lion-face.ico"
                    });
                    console.log("Notificação enviada após solicitar permissão!");
                } else {
                    console.log("Permissão de notificação negada.");
                }
            });
        }
    }

    // Função para verificar se o link está presente
    function verificarLink() {
        const link = document.querySelector("a.button[href*='/evaluation/rater/task/new']");
        if (link && link.textContent.includes("Acquire if available")) {
            console.log('Link encontrado!');
            tocarSom();
            mostrarNotificacao();
        } else {
            console.log('Link não encontrado. Atualizando a página...');
            location.reload(); // Atualiza a página após a verificação
        }
    }

    // Verifica a cada 5 segundos
    setInterval(verificarLink, 5000);

    // Solicita permissão de notificação ao carregar o script
    if (Notification.permission !== "granted") {
        Notification.requestPermission().then(permission => {
            if (permission === "granted") {
                console.log("Permissão de notificação concedida.");
            } else {
                console.log("Permissão de notificação não concedida.");
            }
        });
    }
})();